INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988673', 'Unlocking Android', 416, '2009-04-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/ableson.jpg', 'Unlocking Android: A Developer''s Guide provides concise, hands-on instruction for the Android operating system and development tools. This book teaches important architectural concepts in a straightforward writing style and builds on this with practical and useful examples throughout.', 'P', '["Open Source", "Mobile"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182722', 'Android in Action, Second Edition', 592, '2011-01-14', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/ableson2.jpg', 'Android in Action, Second Edition is a comprehensive tutorial for Android developers. Taking you far beyond "Hello Android," this fast-paced book puts you in the driver''s seat as you learn important architectural concepts and implementation strategies. You''ll master the SDK, build WebKit apps using HTML 5, and even learn to extend or replace Android''s built-in features by building useful and intriguing examples. ', 'P', '["Java"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988320', 'Zend Framework in Action', 432, '2008-12-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/allen.jpg', 'Zend Framework in Action is a comprehensive tutorial that shows how to use the Zend Framework to create web-based applications and web services. This book takes you on an over-the-shoulder tour of the components of the Zend Framework as you build a high quality, real-world web application.', 'P', '["Web Development"]', 10);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988797', 'Flex on Java', 265, '2010-10-15', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/allmon.jpg', '   A beautifully written book that is a must have for every Java Developer.       Ashish Kulkarni, Technical Director, E-Business Software Solutions Ltd.', 'P', '["Internet"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182234', 'Griffon in Action', 375, '2012-06-04', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/almiray.jpg', 'Griffon in Action is a comprehensive tutorial written for Java developers who want a more productive approach to UI development. In this book, you''ll immediately dive into Griffon. After a Griffon orientation and a quick Groovy tutorial, you''ll start building examples that explore Griffon''s high productivity approach to Swing development. One of the troublesome parts of Swing development is the amount of Java code that is required to get a simple application off the ground.', 'P', '["Java"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('193518217X', 'OSGi in Depth', 325, '2011-12-12', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/alves.jpg', 'Enterprise OSGi shows a Java developer how to develop to the OSGi Service Platform Enterprise specification, an emerging Java-based technology for developing modular enterprise applications. Enterprise OSGi addresses several shortcomings of existing enterprise platforms, such as allowing the creation of better maintainable and extensible applications, and provide a simpler, easier-to-use, light-weight solution to enterprise software development.', 'P', '["Java"]', 2);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988509', 'Flexible Rails', 592, '2008-01-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/armstrong.jpg', '"Flexible Rails created a standard to which I hold other technical books. You definitely get your money''s worth."', 'P', '["Web Development"]', 7);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988762', 'Hello! Flex 4', 258, '2009-11-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/armstrong3.jpg', 'Hello! Flex 4 progresses through 26 self-contained examples selected so you can progressively master Flex. They vary from small one-page apps, to a 3D rotating haiku, to a Connect Four-like game. And in the last chapter you''ll learn to build a full Flex application called SocialStalkr   a mashup that lets you follow your friends by showing their tweets on a Yahoo map.', 'P', '["Internet"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1884777384', 'Coffeehouse', 316, '1997-07-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/asher.jpg', 'Coffeehouse is an anthology of stories, poems and essays originally published on the World Wide Web.', 'P', '["Miscellaneous"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988711', 'Brownfield Application Development in .NET', 550, '2010-04-16', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/baley.jpg', 'Brownfield Application Development in .Net shows you how to approach legacy applications with the state-of-the-art concepts, patterns, and tools you''ve learned to apply to new projects. Using an existing application as an example, this book guides you in applying the techniques and best practices you need to make it more maintainable and receptive to change.', 'P', '["Microsoft"]', 9);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182870', 'MongoDB in Action', 0, '2011-12-12', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/banker.jpg', 'MongoDB In Action is a comprehensive guide to MongoDB for application developers. The book begins by explaining what makes MongoDB unique and describing its ideal use cases. A series of tutorials designed for MongoDB mastery then leads into detailed examples for leveraging MongoDB in e-commerce, social networking, analytics, and other common applications.', 'P', '["Next Generation Databases"]', 6);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('193239415X', 'Hibernate in Action', 400, '2004-08-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/bauer.jpg', '"2005 Best Java Book!" -- Java Developer''s Journal', 'P', '["Java"]', 1);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1932394885', 'Java Persistence with Hibernate', 880, '2006-11-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/bauer2.jpg', '"...this book is the ultimate solution. If you are going to use Hibernate in your application, you have no other choice, go rush to the store and get this book." --JavaLobby', 'P', '["Java"]', 4);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1932394826', 'iBATIS in Action', 384, '2007-01-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/begin.jpg', '   Gets new users going and gives experienced users in-depth coverage of advanced features.       Jeff Cunningham, The Weather Channel Interactive', 'P', '["Web Development"]', 7);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('133046192', 'Designing Hard Software', 350, '1997-02-01', NULL, '"This book is well written ... The author does not fear to be controversial. In doing so, he writes a coherent book." --Dr. Frank J. van der Linden, Phillips Research Laboratories', 'P', '["Object-Oriented Programming", "S"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988649', 'Hibernate Search in Action', 488, '2008-12-21', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/bernard.jpg', '"A great resource for true database independent full text search." --Aaron Walker, base2Services', 'P', '["Java"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988355', 'jQuery in Action', 376, '2008-01-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/bibeault.jpg', '"The best-thought-out and researched piece of literature on the jQuery library." --From the forward by John Resig, Creator of jQuery', 'P', '["Web Development"]', 6);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182323', 'jQuery in Action, Second Edition', 488, '2010-06-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/bibeault2.jpg', 'jQuery in Action, Second Edition is a fast-paced introduction to jQuery that will take your JavaScript programming to the next level. An in-depth rewrite of the bestselling first edition, this edition provides deep and practical coverage of the latest jQuery and jQuery UI releases. The book''s unique "lab pages" anchor the explanation of each new concept in a practical example. You''ll learn how to traverse HTML documents, handle events, perform animations, and add Ajax to your web pages. This comprehensive guide also teaches you how jQuery interacts with other tools and frameworks and how to build jQuery plugins. ', 'P', '["Java"]', 1);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1884777295', 'Building Secure and Reliable Network Applications', 591, '1996-01-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/birman.jpg', '"... tackles the difficult problem of building reliable distributed computing systems in a way that not only presents the principles but also describes proven practical solutions." --John Warne, BNR Europe', 'P', '["Networking", "Theory"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1932394699', 'Ruby for Rails', 532, '2006-05-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/black.jpg', 'The word is out: with Ruby on Rails you can build powerful Web applications easily and quickly! And just like the Rails framework itself, Rails applications are Ruby programs. That means you can   t tap into the full power of Rails unless you master the Ruby language.', 'P', '["Web Development"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988657', 'The Well-Grounded Rubyist', 520, '2009-04-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/black2.jpg', 'What would appear to be the most complex topic of the book is in fact surprisingly easy to assimilate, and one realizes that the efforts of the author to gradually lead us to a sufficient knowledge of Ruby in order to tackle without pain the most difficult subjects, bears its fruit.       Eric Grimois, Developpez.com', 'P', '["Programming"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988452', 'Website Owner''s Manual', 296, '2009-10-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/boag.jpg', 'Website Owner''s Manual helps you form a vision for your site, guides you through the process of selecting a web design agency, and gives you enough background information to make intelligent decisions throughout the development process. This book provides a jargon-free overview of web design, including accessibility, usability, online marketing, and web development techniques. You''ll gain a practical understanding of the technologies, processes, and ideas that drive a successful website.', 'P', '["Internet"]', 2);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182463', 'ASP.NET 4.0 in Practice', 504, '2011-05-15', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/bochicchio.jpg', 'ASP.NET 4.0 in Practice contains real world techniques from well-known professionals who have been using ASP.NET since the first previews.', 'P', '["Microsoft .NET"]', 9);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182080', 'Hello! Python', 350, '2012-02-13', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/briggs.jpg', 'Hello! Python fully covers the building blocks of Python programming and gives you a gentle introduction to more advanced topics such as object oriented programming, functional programming, network programming, and program design. New (or nearly new) programmers will learn most of what they need to know to start using Python immediately.', 'P', '["Python"]', 7);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('193398886X', 'iPhone in Action', 472, '2008-12-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/callen.jpg', '   There is not another iPhone title that does such a great coverage of both Web and SDK topics under one roof, thus providing a well-rounded developer education.       Vladimir Pasman, Cocoacast.com', 'P', '["Web Development"]', 2);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988428', 'Silverlight 2 in Action', 400, '2008-10-31', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/campbell.jpg', '   Silverlight 2 in Action gives you a solid, well-thought out and coherent foundation for building RIA web applications, and provides you with lots of technical details without ever becoming cloudy.       Golo Roden, author, trainer and speaker for .NET technologies', 'P', '["Microsoft .NET"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('193518220X', 'The Quick Python Book, Second Edition', 360, '2010-01-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/ceder.jpg', 'This revision of Manning''s popular The Quick Python Book offers a clear, crisp introduction to the elegant Python programming language and its famously easy-to-read syntax. Written for programmers new to Python, this updated edition covers features common to other languages concisely, while introducing Python''s comprehensive standard functions library and unique features in detail.', 'P', '["Python"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('188477752X', 'Practical Methods for Your Year 2000 Problem', 236, '1998-01-01', NULL, 'Practical Methods for Your Year 2000 Problem gives the Year 2000 project team a step-by-step methodology for addressing the Year 2000 problem.', 'P', '["Business"]', 6);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1884777368', 'Mobile Agents', 320, '1997-03-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/cockayne.jpg', 'Mobile Agents is the first book to give the reader the ability to create and use powerful mobile agents on the Internet.', 'P', '["Internet"]', 4);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182307', 'Spring Dynamic Modules in Action', 450, '2010-09-04', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/cogoluegnes.jpg', 'Spring Dynamic Modules in Action introduces Spring DM and OSGi to Java EE developers and architects. It presents the fundamental concepts of OSGi-based apps and maps them to the familiar ideas of the Spring framework. Then, it engages you with the techniques and concepts you''ll need to develop stable, flexible enterprise apps. You''ll learn how to embed a Spring container inside an OSGi bundle, and how Spring DM lets you blend Spring strengths like dependency injection with OSGi-based services. Along the way, you''ll see how Spring DM handles data access and web-based components, and you''ll explore topics like unit testing and configuration in an OSGi-based environment.', 'P', '["Java"]', 7);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182927', 'Android in Practice', 500, '2011-09-30', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/collins.jpg', 'Android in Practice is treasure trove of Android goodness, with over 100 tested, ready-to-use techniques including complete end-to-end example applications and practical tips for real world mobile application developers. Written by real world Android developers, this book addresses the trickiest questions raised in forums and mailing lists. Using an easy-to-follow problem/solution/discussion format, it dives into important topics not covered in other Android books, like advanced drawing and graphics, testing and instrumentation, building and deploying applications, using alternative languages, and native development.', 'P', '["Mobile Technology"]', 2);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1932394583', 'POJOs in Action', 592, '2006-01-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/crichardson.jpg', '"POJOs in Action is required reading for battle-weary EJB developers and for new developers who want to avoid the sins of the fathers by using lightweight frameworks.    -- C# Online.NET', 'P', '["Java"]', 9);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182897', 'Hello! HTML5 & CSS3', 325, '2012-10-17', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/crowther.jpg', 'Quick and Easy HTML5 and CSS3 is written for the web designer or developer who wants a fast, example-oriented introduction to the new HTML and CSS features. After a quick review of the basics, you''ll turn to what''s new. Start by learning to apply important new elements and attributes by building your first real HTML5 pages. You''ll then take a quick tour through the new APIs: Form Validation, Canvas, Drag & Drop, Geolocation and Offline Applications. You''ll also discover how to include video and audio on your pages without plug-ins, and how to draw interactive vector graphics with SVG.', 'P', '["Internet"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988401', 'Seam in Action', 624, '2008-08-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/dallen.jpg', 'Seam in Action goes into great detail on the ways in which Seam helps reduce the burden of integration with different technologies such as Hibernate and JSF, allowing the developer to focus on the core business objective at hand.       Shobana Jayaraman, Digital Infrastructure Analyst, University of Texas Southwestern Medical Center Library, The Tech Static', 'P', '["Java"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988290', 'GWT in Practice', 376, '2008-04-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/cooper.jpg', 'Sin resumen', 'P', '["Web Development"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988932', 'Grails in Action', 520, '2009-05-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/gsmith.jpg', 'Grails in Action is a comprehensive guide to the Grails framework. First, the basics: the domain model, controllers, views, and services. Then, the fun! Dive into a Twitter-style app with features like AJAX/JSON, animation, search, wizards   even messaging and Jabber integration. Along the way, you''ll discover loads of great plugins that''ll make your app shine. Learn to integrate with existing Java systems using Spring and Hibernate. You''ll need basic familiarity with Java and the web.', 'P', '["Java"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1884777759', 'Up to Speed with Swing, Second Edition', 560, '1999-10-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/gutz2.jpg', 'Now in its Second Edition, Up to Speed with Swing is for you if you want to get on the fast track to Java Swing. The second edition has been extensively updated to cover Java 1.2 with additional code examples and illustrations.', 'P', '["Java"]', 10);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988916', 'OSGi in Action', 576, '2011-04-06', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/hall.jpg', 'OSGi in Action is a comprehensive guide to OSGi with two primary goals. First, it provides a clear introduction to OSGi concepts with examples that are relevant both for architects and developers. The central idea of OSGi is modularity, so you start by learning about OSGi bundles. You''ll then see how OSGi handles module lifecycles and follow up with how it promotes service-oriented interaction among application components.', 'P', '["Internet"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988754', 'SharePoint 2010 Site Owner''s Manual', 300, '2012-02-13', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/harryman.jpg', 'SharePoint 2010 Site Owner''s Manual starts by assuming you already have SharePoint installed on your system and are looking for ways to solve the problems you face every day in your organization. You''ll learn to determine what type of SharePoint installation you have   Microsoft Office SharePoint Server (MOSS), Windows SharePoint Services (WSS), the "Fabulous 40" templates   and what features are at your disposal. Once you know the lay of the land, you''ll discover what you can do yourself, when you need to call in some help, and when you should leave it to the developers.', 'P', '["Microsoft .NET"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1930110588', 'Java Development with Ant', 672, '2002-08-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/hatcher.jpg', 'The most widely used build tool for Java projects, Ant is cross-platform, extensible, simple, and fast. It scales from small personal projects to large, multi-team J2EE projects. And, most important, it''s easy to learn.', 'P', '["Java", "Internet"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1884777481', 'Inside LotusScript', 420, '1997-11-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/mcginn.jpg', 'Develop Notes and Domino Web applications by providing advanced LotusScript code for direct use in your programs. This book emphasizes practical, useable code and solutions to common Notes programming problems.', 'P', '["Business"]', 9);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988177', 'Lucene in Action, Second Edition', 532, '2010-07-09', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/hatcher3.jpg', 'With clear writing, reusable examples, and unmatched advice on best practices, Lucene in Action is still the definitive guide to developing with Lucene.', 'P', '["Java", "Open Source"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1884777708', 'PowerBuilder 6.0 Questions & Answers', 446, '1998-07-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/hatton.jpg', 'If you''d like to learn PowerBuilder--or enhance your skills-- this book is for you. Its hands-on approach will show you how to write real code. Each section takes a specific "How do I " topic and answers commonly asked questions in an easy-to-understand, conversational manner. It then shows you how the same technique can be used over and over again to decrease your overall code-writing time.', 'P', '["PowerBuilder"]', 4);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1884777538', 'The Awesome Power of PowerJ', 378, '1998-05-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/hatton2.jpg', 'The Awesome Power of PowerJ shows you how you can write Java programs the very first day with PowerJ, even if you don''t know Java. Through a hands-on approach that makes liberal use of figures and code snippets, you will learn how to use PowerJ to build effective Java applets and applications.', 'P', '["Java"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1884777546', 'The Awesome Power of Power++', 416, '1998-06-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/hatton3.jpg', 'The Awesome Power of Power++ is for the beginning to intermediate Power++ programmer. It assumes that you have little or no knowledge of the C++ language but that you do know programming constructs. The purpose is to teach you how to use Power++ to build C++ applets and applications even if you are not a C++ expert. To this end it takes a hands-on approach and makes liberal use of figures and code snippets.', 'P', '["PowerBuilder"]', 7);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('193518248X', 'Azure in Action', 425, '2010-10-22', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/hay.jpg', 'Azure in Action is a fast-paced tutorial intended for architects and developers looking to develop on Windows Azure and the Windows Azure Platform. It''s designed both for readers new to cloud concepts and for those familiar with cloud development but new to Azure. After a quick walk through the basics, it guides you all the way from your first app through more advanced concepts of the Windows Azure Platform.', 'P', '["Microsoft .NET"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182412', 'Distributed Agile in Action', 325, NULL, 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/hazrati.jpg', 'Distributed Agile in Action is the first book to directly address the unique task of going Agile in a distributed team. Rather than rehashing Agile theories, this book supplies the practical examples and step by step advice you need to help your distributed teams adopt and embrace Agile principles. It''s a distilled and carefully organized learning aid for working in a distributed Agile environment, with in-depth focus on how to approach three critical components of development-People, Process and Technology.', 'M', '["Software Engineering"]', 1);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1930110979', 'Code Generation in Action', 350, '2003-07-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/herrington.jpg', 'Code Generation In Action covers building database access, user interface, remote procedure, test cases, and business logic code as well as code for other key system functions.', 'P', '["Programming"]', 7);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182633', 'Agile ALM', 0, '2011-08-20', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/huettermann.jpg', 'Many software projects fail unnecessarily because of unclear objectives, redundant and unproductive work, cost overruns, and a host of other avoidable process problems. In response, agile processes and lightweight tooling have begun to replace traditional engineering processes throughout the development lifecycle. An agile approach to application lifecycle management improves product quality, reduces time to market, and makes for happier developers.    Agile ALM is a guide for Java developers who want to integrate flexible agile practices and lightweight tooling along all phases of the software development process. The book introduces a new vision for managing change in requirements and process more efficiently and flexibly. You''ll learn powerful practices like task-based Development, where you align activities into tasks resulting in traceable artifacts, Continuous Integration, in which you frequently and systematically integrate, build, and test an application in development and using Scrum as an agile approach to release management. The effect is a more comprehensive and practical approach to build, configuration, deployment, release, test, quality, integration, and requirements management.    This book synthesizes technical and functional elements to provide a comprehensive approach to software development. You''ll learn to see the whole scope of the development process as a set of defined tasks, many of which are repeated daily, and then master the tools and practices you need to accomplish each of those tasks efficiently.    Because efficient tool chains can radically improve the speed and fluidity of the development process, this book demonstrates how to integrate state-of-the-art lightweight tools. Many of the tools and examples are Java-based, but the Agile ALM principles apply to all development platforms. As well, the many examples show how you can bridge different languages and systems.', 'P', '["Software Engineering"]', 6);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182366', 'Camel in Action', 375, '2011-01-04', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/ibsen.jpg', 'Camel in Action is for developers working with integration of any kind. This highly practical book introduces Camel and shows examples of how to use it with the 45+ supported enterprise integration patterns. Written by the people who wrote the Camel code, it''s up to date and distills details and insights that only people deeply involved with Camel could provide.', 'P', '["Java"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('193398838X', 'Taming Text', 350, '2012-12-31', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/ingersoll.jpg', 'Taming Text is a hands-on, example-driven guide to working with unstructured text in the context of real-world applications. This book explores how to automatically organize text using approaches such as full-text search, proper name recognition, clustering, tagging, information extraction, and summarization. The book guides you through examples illustrating each of these topics, as well as the foundations upon which they are built.', 'P', '["Software Engineering"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1617290017', 'iOS 4 in Action', 504, '2011-06-09', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/jharrington.jpg', 'iOS 4 in Action, written for Xcode 4, is a detailed, hands-on guide that goes from setting up your development environment, through your first coding steps, all the way to creating a polished, commercial iOS 4 application. You''ll run through examples from a variety of areas including a chat client, a video game, an interactive map, and background audio. You''ll also learn how the new iOS 4 features apply to your existing iOS 3 based apps. This book will help you become a confident, well-rounded iOS 4 developer.', 'P', '["Mobile Technology"]', 2);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1932394753', 'PHP in Action', 552, '2007-07-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/reiersol.jpg', '"If there was ever a textbook for software development in PHP, this would be it."    Cal Evans, Podcast Review, Zend Developer Network', 'P', '["PHP"]', 6);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1617290211', 'Learn Windows PowerShell in a Month of Lunches', 0, '2011-04-15', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/jones.jpg', 'Learn Windows PowerShell in a Month of Lunches is an innovative tutorial designed for busy administrators. Author Don Jones has taught thousands of administrators to use PowerShell, and now he''ll teach you, bringing his years of training techniques to a concise, easy-to-follow book. Just set aside one hour a day   lunchtime would be perfect   for an entire month, and you''ll be automating administrative tasks faster than you ever thought possible. Don combines his own in-the-trenches experience with years of PowerShell instruction to deliver the most important, effective, and engaging elements of PowerShell to you quickly and painlessly, setting you on the path to a career-boosting future.', 'P', '["Microsoft .NET"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182390', 'R in Action', 375, '2011-08-15', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/kabacoff.jpg', 'R in Action is the first book to present both the R system and the use cases that make it such a compelling package for business developers. The book begins by introducing the R language, including the development environment. As you work through various examples illustrating R''s features, you''ll also get a crash course in practical statistics, including basic and advanced models for normal and non-normal data, longitudinal and survival data, and a wide variety of multivariate methods. Both data mining methodologies and approaches to messy and incomplete data are included.', 'P', '["Software Engineering"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182277', 'Rails 3 in Action', 425, '2011-09-20', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/katz.jpg', 'Rails 3 in Action will provide a thorough introduction to Ruby-based web development using Rails. Like Rails 3 itself, this book combines Merb and Rails in the form of authors Yehuda Katz, Merb Lead Developer.', 'P', '["Internet"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1884777082', 'Client/Server Yellow Pages', 280, '1995-01-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/lewis.jpg', 'This unique guide covers software products and vendors active in the client/server marketplace. Over 200 products and over 250 vendors are included.', 'P', '["Client-Server"]', 2);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182552', 'Continuous Integration in .NET', 328, '2011-03-14', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/kawalerowicz.jpg', 'Continuous Integration in .NET is a tutorial for developers and team leads that teaches you to reimagine your development strategy by creating a consistent continuous integration process. This book shows you how to build on the tools you already know--.NET Framework and Visual Studio and to use powerful software like MSBuild, Subversion, TFS 2010, Team City, CruiseControl.NET, NUnit, and Selenium.', 'P', '["Microsoft .NET"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1932394133', 'Technology Paradise Lost', 260, '2004-03-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/keller.jpg', 'In Technology Paradise Lost Keller describes how the new thinking is working inside some of the country''s most complex and successful organizations, including Merrill Lynch, JetBlue, Harrah''s, and Motorola which have cut IT spending to gain a competitive edge, and experienced marked gains to their bottom lines.', 'P', '["Business"]', 4);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182447', 'Groovy in Action, Second Edition', 700, NULL, 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/koenig2.jpg', 'Groovy in Action, Second Edition is a thoroughly-revised, comprehensive guide to Groovy programming. It introduces Java developers to the dynamic features that Groovy provides, and shows you how to apply Groovy to a range of tasks including building new apps, integration with existing code, and DSL development.', 'M', '["Java"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('132612313', 'Object Technology Centers of Excellence', 200, '1996-06-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/korson.jpg', 'Object Technology Centers of Excellence provides guidance to those charged with managing the shift to object technology. It is the only book on the market aimed not at the project level but at the corporate level, with a focus on the infrastructures necessary for a successful transition.', 'P', '["Object-Technology Programming", ""]', 9);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182943', 'Making Java Groovy', 0, '2013-09-19', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/kousen.jpg', 'Making Java Groovy is a practical handbook for developers who want to blend Groovy into their day-to-day work with Java. It starts by introducing the key differences between Java and Groovy   and how you can use them to your advantage. Then, it guides you step-by-step through realistic development challenges, from web applications to web services to desktop applications, and shows how Groovy makes them easier to put into production.', 'P', '["Java"]', 4);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1884777473', 'The Awesome Power of Direct3D/DirectX', 840, '2002-12-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/kovach.jpg', 'The Awesome Power of Direct3D/DirectX shows you how to build a complete working 3D application, including 3D sound, joystick input, animation, textures, shadows, and even collision detection.', 'P', '["Computer Graphics"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988053', 'AspectJ in Action, Second Edition', 568, '2009-09-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/laddad2.jpg', 'AspectJ in Action, Second Edition is a fully updated, major revision of Ramnivas Laddad''s best-selling first edition. It''s a hands-on guide for Java developers. After introducing the core principles of AOP, it shows you how to create reusable solutions using AspectJ 6 and Spring 3. You''ll master key features including annotation-based syntax, load-time weaver, annotation-based crosscutting, and Spring-AspectJ integration. Building on familiar technologies such as JDBC, Hibernate, JPA, Spring Security, Spring MVC, and Swing, you''ll apply AOP to common problems encountered in enterprise applications.', 'P', '["Java"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182196', 'Hadoop in Action', 325, '2010-12-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/lam.jpg', 'Hadoop in Action teaches readers how to use Hadoop and write MapReduce programs. The intended readers are programmers, architects, and project managers who have to process large amounts of data offline. Hadoop in Action will lead the reader from obtaining a copy of Hadoop to setting it up in a cluster and writing data analytic programs.', 'P', '["Java"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182250', 'F# in Action', 425, NULL, 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/laucher.jpg', 'F# in Action introduces the F# language, but it goes well beyond the standard tutorial and reference approach. F# expert Amanda Laucher draws on her extensive experience deploying F#-based solutions to show you how to use F# in real, day-to-day work.', 'M', '["Microsoft .NET"]', 9);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988894', 'Tuscany SCA in Action', 472, '2011-02-12', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/laws.jpg', 'Tuscany in Action is a comprehensive, hands-on guide for developing technology agnostic, extensible applications using Apache Tuscany''s lightweight SCA infrastructure. The book uses practical examples based on a travel booking scenario to demonstrate how to develop applications with Tuscany SCA. Apache Tuscany supports a variety of programming environments, data bindings and communication protocols "out of the box" and can be easily extended to support other technologies.', 'P', '["Java"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1884777066', 'Object Oriented Application Frameworks', 352, '1995-04-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/lewis2.jpg', 'Frameworks are object-oriented programming environments for vertical application areas. This book is the first to survey this exciting new technology, its concepts, and practical applications.', 'P', '["Object-Oriented Programming"]', 9);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988789', 'Erlang and OTP in Action', 500, '2010-11-16', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/logan.jpg', 'Erlang and OTP in Action teaches you to apply Erlang''s shared-state model for concurrent programming--a completely different way of tackling the problem of parallel programming from the more common multi-threaded approach. This book walks you through the practical considerations and steps of building systems in Erlang and integrating them with real-world C/C++, Java, and .NET applications. Unlike other books on the market, Erlang and OTP in Action offers a comprehensive view of how concurrency relates to SOA and web technologies.', 'P', '["Programming"]', 6);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988819', 'SharePoint 2007 Developer''s Guide to Business Data Catalog', 304, '2009-09-09', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/lonsdale.jpg', 'SharePoint 2007 Developer''s Guide to Business Data Catalog is a practical, example-rich guide to the features of the BDC and the techniques you need to build solutions for end users. The book starts with the basics   what the BDC is, what you can do with it, and how to pull together a BDC solution. With the fundamentals in hand, it explores the techniques and ideas you need to put BDC into use effectively in your organization.', 'P', '["Microsoft .NET"]', 4);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('133964256', 'Doing IT Right', 350, '1995-12-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/lorin.jpg', 'Doing IT Right explores IT in its full complexity. It explains fundamental issues of hardware and software structures; it illuminates central issues of networking and encapsulates the essence of client/server computing; its coverage of costing, risk assessment, and due diligence in making computing decisions is unique.', 'P', '["Business", "Software Engineering"]', 4);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('193239480X', 'Ant in Action', 600, '2007-07-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/loughran.jpg', 'The most widely used build tool for Java projects, Ant is cross-platform, extensible, simple, and fast. It scales from small personal projects to large, multi-team enterprise projects. And, most important, it   s easy to learn.', 'P', '["Java"]', 10);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('193518234X', 'Restlet in Action', 450, '2012-09-26', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/louvel.jpg', 'Restlet in Action gets you started with the Restlet Framework and the REST architecture style. You''ll create and deploy applications in record time while learning to use popular RESTful Web APIs effectively. This book looks at the many faces of web development, including server- and client-side, along with cloud computing, mobile Android devices, and semantic web applications. It offers a particular focus on Google''s innovative Google Web Toolkit, Google App Engine, and Android technologies.', 'P', '["Internet"]', 2);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1932394796', 'iText in Action', 688, '2006-11-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/lowagie.jpg', '"I''ve been using iText for over a year, but I still learnt an awful lot while reading this book." --JavaLobby', 'P', '["Web Development"]', 10);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182617', 'iText in Action, Second Edition', 600, '2010-11-22', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/lowagie2.jpg', 'iText in Action, Second Edition offers an introduction and a practical guide to iText and the internals of PDF. While at the entry level iText is easy to learn, there''s an astonishing range of things you can do once you dive below the surface. This book lowers the learning curve and, though numerous innovative and practical examples, unlocks the secrets hidden in Adobe''s PDF Reference. The examples are in Java but they can be easily adapted to .NET using one of iText''s .NET ports: iTextSharp or iText.NET.', 'P', '["Java"]', 2);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('131271687', 'SNA and TCP/IP Enterprise Networking', 540, '1997-09-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/lynch.jpg', 'SNA and TCP/IP Enterprise Networking shows the reader how enterprise networking evolved, what approaches and techniques can be used today, and where tomorrow''s trends lie, illustrating among others Web-to-SNA connectivity and Java based integration approaches.', 'P', '["Software Engineering", "Theory"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1932394478', 'Subversion in Action', 356, '2004-12-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/machols.jpg', 'Learn all about this new open source version control application and why it is replacing CVS as the standard. Examples demonstrate how to customize features to deal with day-to-day problems.', 'P', '["Java"]', 4);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('013319955X', 'Comprehensive Networking Glossary and Acronym Guide', 208, '1995-01-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/malkin.jpg', 'This glossary offers a complete collection of technical terms and acronyms used in the networking industry.', 'P', '["Internet"]', 9);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('132621894', 'Planning and Managing ATM Networks', 320, '1997-06-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/minoli.jpg', 'Planning and Managing ATM Networks covers strategic planning, initial deployment, overall management, and the day-to-day operation of ATM networks.', 'P', '["Client-Server", "Networking"]', 10);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('132869985', 'Internet BBSs', 400, '1996-10-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/mark.jpg', 'Internet BBSs: A Guided Tour provides in-depth coverage of the new world of true BBSs now available world-wide. It is a valuable resource for anyone currently using the Internet.', 'P', '["Internet"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('137353006', 'Client/Server Applications on ATM Networks', 350, '1997-01-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/minoli2.jpg', 'Client/Server Appliactions on ATM Networks discusses ATM as the key technology for transforming the enterprise network from data-only to an integrated data, voice, video, image and multimedia corporate infrastructure.', 'P', '["Client-Server", "Networking"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182188', 'Entity Framework 4 in Action', 576, '2011-05-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/mostarda.jpg', 'Microsoft Entity Framework in Action introduces the Entity Framework to developers working in .NET who already have some knowledge of ADO.NET. The book begins with a review of the core ideas behind the ORM model and shows how Entity Framework offers a smooth transition from a traditional ADO.NET approach. By presenting numerous small examples and a couple larger case studies, the book unfolds the Entity Framework story in clear, easy-to-follow detail. The infrastructure and inner workings will be highlighted only when there   s the need to understand a particular feature.', 'P', '["Microsoft .NET"]', 2);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('193239477X', 'ASP.NET 2.0 Web Parts in Action', 344, '2006-09-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/neimke.jpg', '"ASP.NET Web Parts in Action is a must read book for every developer who wants to extend his knowledge of the ASP.NET framework." -- Simon Busoli, DotNetSlackers.com', 'P', '["Microsoft"]', 1);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1617290149', 'Sass and Compass in Action', 300, '2013-07-26', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/netherland.jpg', 'Sass and Compass in Action is the definitive guide to stylesheet authoring using these two revolutionary tools. Written for both designers and developers, this book demonstrates the power of both Sass and Compass through a series of examples that address common pain points associated with traditional stylesheet authoring. The book begins with simple topics such as CSS resets and moves on to more involved topics such as grid frameworks and CSS3 vendor implementation differences.', 'P', '["Web Development"]', 4);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1884777503', 'Core OWL 5.0', 500, '1997-12-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/neward.jpg', 'Core OWL 5.0 dives under the surface and into the OWL source code itself. You''ll see what new capabilities OWL 5.0 offers the OWL programmer. You''ll gain a deeper understanding of what OWL does on your behalf such as the OWL messaging system and its message maps.', 'P', '["Programming"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('193398869X', 'Secrets of the JavaScript Ninja', 300, '2012-12-27', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/resig.jpg', '   Secrets of the Javascript Ninja is definitely a book for anyone looking to significantly improve their Javascript knowledge and skills.       Ryan Doherty, Web Development Engineer, Mozilla', 'P', '["Java"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1884777465', 'Advanced OWL 5.0', 570, '1998-01-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/neward2.jpg', 'Advanced OWL 5.0 covers advanced ways to make the OWL library do those tricky things you thought weren''t possible. You''ll get a long, exhaustive look at the new features introduced by the OWL 5.0 code. You''ll find detailed explanations of how to extend the OWL objects themselves in new directions.', 'P', '["Programming"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182048', 'SQL Server MVP Deep Dives', 848, '2009-11-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/nielsen.jpg', 'SQL Server MVP Deep Dives is organized into five parts: Design and Architecture, Development, Administration, Performance Tuning and Optimization, and Business Intelligence. In each, you''ll find concise, brilliantly clear chapters that take on key topics like mobile data strategies, Dynamic Management Views, or query performance.', 'P', '["Microsoft .NET"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182269', 'PostGIS in Action', 325, '2011-04-11', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/obe.jpg', 'PostGIS in Action is the first book devoted entirely to PostGIS. It will help both new and experienced users write spatial queries to solve real-world problems. For those with experience in more traditional relational databases, this book provides a background in vector-based GIS so you can quickly move to analyzing, viewing, and mapping data.', 'P', '["Internet"]', 6);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1930110855', 'Programming Mac OS X', 384, '2003-01-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/omalley.jpg', '"...an effective guide for Unix developers who want accurate information specifically on getting up to speed with Mac OS X and its software development environment, without having to sort through the morass of online information overload. ...If you''ve been a little skittish about Interface Builder, forget your worries now because the tutorial in the book is very good. ...The projects and examples are thorough and should provide even the most jaded intermediate programmer with a real taste of how challenging and satisfying it can be to code for OSX." - KickStartNews.com', 'P', '["Programming"]', 2);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988622', 'ASP.NET MVC in Action', 392, '2009-09-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/palermo.jpg', 'ASP.NET MVC in Action is a guide to pragmatic MVC-based web development. After a thorough overview, it dives into issues of architecture and maintainability. The book assumes basic knowledge of ASP.NET (v. 3.5) and expands your expertise.', 'P', '["Microsoft .NET"]', 6);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('193518279X', 'ASP.NET MVC 2 in Action', 432, '2010-06-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/palermo2.jpg', 'ASP.NET MVC 2 in Action is a fast-paced tutorial designed to introduce the MVC model to ASP.NET developers and show how to apply it effectively. After a high-speed ramp up, the book presents over 25 concise chapters exploring key topics like validation, routing, and data access. Each topic is illustrated with its own example so it''s easy to dip into the book without reading in sequence. This book covers some high-value, high-end techniques you won''t find anywhere else!', 'P', '["Microsoft .NET"]', 4);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1617290416', 'ASP.NET MVC 4 in Action', 450, '2012-05-25', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/palermo3.jpg', 'SP.NET MVC 3 in Action is a fast-paced tutorial designed to introduce ASP.NET MVC to .NET developers and show how to apply it effectively. After a high-speed ramp up, the book explores key topics like validation, routing, and data access. Each topic is illustrated with its own example so it''s easy to dip into the book without reading in sequence. This book also covers some high-value, high-end techniques you won''t find anywhere else!', 'P', '["Microsoft .NET"]', 4);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182994', 'EJB 3 in Action, Second Edition', 0, '2014-04-07', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/panda2.jpg', 'Building on the bestselling first edition, EJB 3 in Action, Second Edition tackles EJB 3.1 head-on, through numerous code samples, real-life scenarios, and illustrations. This book is a fast-paced tutorial for Java EE 6 business component development using EJB 3.1, JPA 2 and CDI. Besides covering the basics of EJB 3.1, this book includes in-depth EJB 3.1 internal implementation details, best practices, design patterns, and performance tuning tips. The book also discusses using open source frameworks like Seam and Spring with EJB 3.1.', 'P', '["Java"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1932394206', 'Explorer''s Guide to the Semantic Web', 304, '2004-06-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/passin.jpg', '"A thorough look at one vision of the Web''s future ...particularly well written...Highly recommended." -- Choice Magazine', 'P', '["Internet", "Theory", "XML"]', 4);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1932394907', 'Windows PowerShell in Action', 576, '2007-02-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/payette.jpg', '   If all it had going for it was the authoratative pedigree of the writer, it might be worth it, but it''s also well-written, well-organized, and thorough, which I think makes it invaluable as both a learning tool and a reference.       Slashdot.org', 'P', '["Microsoft"]', 2);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182137', 'Windows PowerShell in Action, Second Edition', 700, '2011-05-15', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/payette2.jpg', 'Windows PowerShell in Action, Second Edition is a completely revised edition of the best selling book on PowerShell, written by Bruce Payette, one of the founding members of the Windows PowerShell team, co-designer of the PowerShell language, and the principal author of the PowerShell language implementation.    This new edition preserves the crystal-clear introduction to PowerShell, showing sysadmins and developers how to build scripts and utilities to automate system tasks or create powerful system management tools to handle day-to-day tasks. It''s rich with interesting examples that will spark your imagination. The book covers batch scripting and string processing, COM, WMI, remote management and jobs and even .NET programming including WinForms and WPF/XAML.', 'P', '["Microsoft"]', 4);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182374', 'Silverlight 4 in Action, Revised Edition', 425, '2010-10-04', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/pbrown.jpg', 'Silverlight in Action, Revised Edition is a comprehensive guide to Silverlight, taking you from Hello World through the techniques you''ll need to build sophisticated rich web apps. This new edition covers all the new features added in the latest versions of Silverlight, Visual Studio, and Expression Blend, along with the best practices emerging in the Silverlight community. With more than 50% new content, you''ll take a mind-expanding trip through the technology, features, and techniques required to build applications ranging from media, to custom experiences, to business applications to games.', 'P', '["Microsoft .NET"]', 6);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1932394419', 'Hibernate Quickly', 456, '2005-08-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/peak.jpg', '"If you want to learn Hibernate quickly, this book shows you step by step." - Sang Shin, Java Technology Architect, Sun Microsystems', 'P', '["Java"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1617290092', 'Windows Phone 7 in Action', 0, '2012-08-21', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/perga.jpg', 'Windows Phone 7 in Action is a hands-on guide to building mobile applications for WP7 using Silverlight, C#, and XNA. Written for developers who already know their way around Visual Studio, this book zips through the basics, such as writing code to dial the phone, writing emails, and sending text messages, and moves on to the nuts and bolts of building great phone apps. By working through the numerous examples and tutorials, you''ll master the APIs used to work with a phone''s sensors and hardware, such as the accelerometer, camera, touch screen, GPS, and microphone. You''ll also tackle web services and applications that use location and push notification services.', 'P', '["Mobile Technology"]', 7);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988924', 'Real-World Functional Programming', 560, '2009-12-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/petricek.jpg', 'This book teaches the ideas and techniques of functional programming applied to real-world problems. You''ll see how the functional way of thinking changes the game for .NET developers. Then, you''ll tackle common issues using a functional approach. The book will also teach you the basics of the F# language and extend your C# skills into the functional domain. No prior experience with functional programming or F# is required.', 'P', '["Microsoft .NET"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1617290181', 'Machine Learning in Action', 0, '2012-04-04', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/pharrington.jpg', 'Machine Learning in Action is a unique book that blends the foundational theories of machine learning with the practical realities of building tools for everyday data analysis. In it, you''ll use the flexible Python programming language to build programs that implement algorithms for data classification, forecasting, recommendations, and higher-level features like summarization and simplification.', 'P', '["Software Engineering"]', 9);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('193398855X', 'Dependency Injection', 352, '2009-08-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/prasanna.jpg', '   If you do large scale java apps, you probably want to have someone on the team have this book.       Michael Neale', 'P', '["Microsoft .NET"]', 6);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1932394591', 'Understanding Enterprise SOA', 280, '2005-11-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/pulier.jpg', '"SOA is real ... Pulier is uniquely qualified to make [it] accessible to the general business audience." - Paul Gaffney, Staples, Inc., From the Foreword', 'P', '["Theory"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988606', 'DSLs in Boo: Domain-Specific Languages in .NET', 352, '2010-01-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/rahien.jpg', 'DSLs in Boo shows you how to design, extend, and evolve DSLs for .NET by focusing on approaches and patterns. You learn to define an app in terms that match the domain, and to use Boo to build DSLs that generate efficient executables. And you won''t deal with the awkward XML-laden syntax many DSLs require. The book concentrates on writing internal (textual) DSLs that allow easy extensibility of the application and framework. And if you don''t know Boo, don''t worry   you''ll learn right here all the techniques you need.  ', 'P', '["Microsoft .NET"]', 10);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1932394621', 'wxPython in Action', 620, '2006-03-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/rappin.jpg', '"The book is easy to read and provides an approach to a very practical contemporary topic. The authors have organized their material well." -- Melissa Strange, Walden University, www.reviews.com', 'P', '["Python"]', 6);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182595', 'Clojure in Action', 475, '2011-11-15', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/rathore.jpg', 'Clojure in Action is a hands-on tutorial for the working programmer who has written code in a language like Java or Ruby, but has no prior experience with Lisp. It teaches Clojure from the basics to advanced topics using practical, real-world application examples. Blow through the theory and dive into practical matters like unit-testing, environment set up, all the way through building a scalable web-application using domain-specific languages, Hadoop, HBase, and RabbitMQ.', 'P', '["Java"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('134529308', 'Working with Objects', 420, '1995-08-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/reenskaug.jpg', '"The first method that deals realistically with reuse, and one of the few that comes close to describing what I do when I design." --Ralph Johnson, University of Illinois', 'P', '["Object-Oriented Programming"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('132623129', 'Microsoft Office Essentials', 480, '1996-07-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/richardson2.jpg', 'Microsoft Office Essentials simply covers the things you really want to know and skips over all those esoteric features that 99 out of 100 readers never use.', 'P', '["Business"]', 2);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('013268327X', 'Personal Videoconferencing', 420, '1996-06-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/rosen.jpg', '"Personal Videoconferencing is having an enormous impact on business. Evan Rosen has quantified that impact with examples of real world implementations and provided a primer on how businesses can achieve this competitive advantage for themselves."  --Frank Gill, Executive Vice President, Internet and Communications Group, Intel    "The book is very good: it is clear and the examples of user applications are excellent"  --Ralph Ungermann, CEO, First Virtual Corporation ', 'P', '["Networking"]', 7);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1884777694', 'Implementing Elliptic Curve Cryptography', 330, '1998-11-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/rosing.jpg', '"The book provides all the theory and working programs needed to create real applications based on the latest IEEE P1363 standard."  --Reviewed in Cryptologia', 'P', '["Theory"]', 2);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988266', 'SOA Patterns', 250, '2012-09-12', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/rotem.jpg', 'In SOA Patterns, author Arnon Rotem-Gal-Oz provides detailed, technology-neutral solutions to these challenges, and many others. This book provides architectural guidance through patterns and anti-patterns. It shows you how to build real SOA services that feature flexibility, availability, and scalability.', 'P', '["SOA"]', 2);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988495', 'Hello World!', 432, '2009-03-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/sande.jpg', 'Hello World! provides a gentle but thorough introduction to the world of computer programming.', 'P', '["Programming", "Python"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182544', 'Portlets in Action', 475, '2011-09-16', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/sarin.jpg', 'Portlets in Action is a comprehensive guide for Java developers with minimal or no experience working with portlets. Fully exploring the Portlet 2.0 API and using widely adopted frameworks like Spring 3.0 Portlet MVC, Hibernate, and DWR, it teaches you portal and portlet development by walking you through a Book Catalog portlet and Book Portal examples.', 'P', '["Java"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1932394273', 'SWT/JFace in Action', 496, '2004-11-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/scarpino.jpg', 'Guides you through the process of developing Eclipse-based GUIs and shows how to build applications with features your users will love. Packed with examples and no fluff.', 'P', '["Java"]', 4);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('138892709', 'Multiprotocol over ATM', 341, '1998-03-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/schmidt.jpg', 'With the detailed coverage of the entire set of protocols in Multiprotocol over ATM, you can be equal to the task.', 'P', '["Internet", "Networking"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182501', 'Dependency Injection in .NET', 375, '2011-10-03', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/seemann.jpg', 'Dependency Injection in .NET is a comprehensive guide than introduces DI and provides an in-depth look at applying DI practices to .NET apps. In it, you will also learn to integrate DI together with such technologies as Windows Communication Foundation, ASP.NET MVC, Windows Presentation Foundation and other core .NET components.', 'P', '["Microsoft .NET"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1930110464', 'Instant Messaging in Java', 402, '2002-03-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/shigeoka.jpg', 'This intermediate Java programming book provides Java programmers with the information and tools needed to create your own IM client and server software.', 'P', '["Internet", "Java"]', 9);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1884777392', 'Java Applets and Channels Without Programming', 372, '1999-12-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/shoffner.jpg', 'Java Applets and Channels Without Programming collects almost 100 applets on a CD with detailed instructions on how to use each applet. In addition, style issues are discussed in detail; not only will you learn how to use each applet, you will learn when and where it is appropriate to use each applet. The book also introduces the new concept of channels and shows how these can be used on your web site as well.  ', 'P', '["Java"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182005', 'PowerShell in Practice', 500, '2010-06-08', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/siddaway.jpg', 'PowerShell in Practice is a hands-on, cookbook-style reference intended for administrators wanting to learn and use PowerShell. Written from an administrator''s perspective, it concentrates on using PowerShell for practical tasks and automation. The book starts with an introduction that includes a rapid tutorial and a review of the key areas in which you''ll use PowerShell.', 'P', '["Microsoft .NET"]', 9);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('132632942', 'Making Sense of Java', 180, '1996-06-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/simpson.jpg', 'Making Sense of Java clearly and concisely explains the concepts, features, benefits, potential, and limitations of Java.', 'P', '["Java", "Business"]', 6);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1932394818', 'C++/CLI in Action', 416, '2007-04-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/sivakumar.jpg', '   ... a great resource, an outstanding job, a must-read...        Ayman B. Shoukry, VC++ Team, Microsoft Corporation', 'P', '["Microsoft"]', 9);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182471', 'C# in Depth, Second Edition', 584, NULL, 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/skeet2.jpg', 'C# in Depth, Second Edition concentrates on the high-value features that make C# such a powerful and flexible development tool. Rather than re-hashing the core of C# that''s essentially unchanged since it hit the scene nearly a decade ago, this book brings you up to speed with the features and practices that have changed with C# from version 2.0 onwards.', 'P', '["Microsoft .NET"]', 6);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1884777589', 'Magical A-Life Avatars', 450, '2000-12-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/small.jpg', '"Distinctive book explaining how to get intelligent software agents to work." --Clipcode.com', 'P', '["Internet", "Theory"]', 7);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988258', 'Becoming Agile', 408, '2009-05-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/smith.jpg', '   Becoming Agile is not another book to be classified in the existing ones handling agile practices, it''s one of the rare writings which will go with you in the adoption and setup/migration to an agile process...This real must-have agilist''s bedside book reads very well and will accompany you in your migration agile practices...       Eric Siber, Developpez.com', 'P', '["Software Engineering"]', 7);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988940', 'ActiveMQ in Action', 408, '2011-03-31', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/snyder.jpg', 'ActiveMQ is implemented in Java, but it supports client applications written in many other programming languages including C/C++, .NET, Ruby, Perl, PHP, Python, and more. It can be integrated with other open source frameworks including Tomcat, ServiceMix, JBoss, and can easily bridge to other JMS providers.  ', 'P', '["Java"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('138411808', 'Implementing PeopleSoft Financials', 220, '1997-01-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/stephens.jpg', 'Implementing PeopleSoft Financials discusses the issues that arise and the pitfalls to avoid. Every member of the implementation team--from entry-level accounting clerk through MIS staff to executive sponsors--will benefit from reading this book.', 'P', '["Business", "Client-Server"]', 2);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182730', 'SQL Server DMVs in Action', 352, '2011-05-09', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/stirk.jpg', 'SQL Server DMVs in Action shows you how to obtain, interpret, and act on the information captured by DMVs to keep your system in top shape. The over 100 code examples help you master DMVs and give you an instantly reusable SQL library. You''ll also learn to use Dynamic Management Functions (DMFs), which provide further details that enable you to improve your system''s performance and health.', 'P', '["Microsoft .NET"]', 7);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182706', 'Scala in Depth', 0, '2012-05-14', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/suereth.jpg', 'Scala in Depth is a unique new book designed to help you integrate Scala effectively into your development process. By presenting the emerging best practices and designs from the Scala community, it guides you though dozens of powerful techniques example by example. There''s no heavy-handed theory here-just lots of crisp, practical guides for coding in Scala.    For example:        * Discover the "sweet spots" where object-oriented and functional programming intersect.      * Master advanced OO features of Scala, including type member inheritance, multiple inheritance and composition.      * Employ functional programming concepts like tail recursion, immutability, and monadic operations.      * Learn good Scala style to keep your code concise, expressive and readable.    As you dig into the book, you''ll start to appreciate what makes Scala really shine. For instance, the Scala type system is very, very powerful; this book provides use case approaches to manipulating the type system and covers how to use type constraints to enforce design constraints. Java developers love Scala''s deep integration with Java and the JVM Ecosystem, and this book shows you how to leverage it effectively and work around the rough spots.', 'P', '["Java"]', 6);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1930110944', 'EJB Cookbook', 352, '2003-05-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/sullins2.jpg', '"This book provides a great reference for the average EJB developer. It provides recipes for most common tasks that an EJB developer would need." -- Computing Reviews, Nov. 2003', 'P', '["Java"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182021', 'JUnit in Action, Second Edition', 504, '2010-07-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/tahchiev.jpg', 'JUnit in Action, Second Edition is an up-to-date guide to unit testing Java applications (including Java EE applications) using the JUnit framework and its extensions. This book provides techniques for solving real-world problems such as testing AJAX applications, using mocks to achieve testing isolation, in-container testing for Java EE and database applications, and test automation.', 'P', '["Java"]', 2);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1930110952', 'Bitter EJB', 440, '2003-05-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/tate2.jpg', '"The book''s informal tone offers a refreshing change from the ubiquitous preachiness of other EJB tomes. It''s pragmatic and doesn''t tap dance around the fact that EJBs are often used incorrectly in enterprise development... it''s an effective way to avoid the potholes that have forced developers off track in the past." -- Software Development Magazine', 'P', '["Java", "Internet"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182587', 'iPhone and iPad in Action', 450, '2010-08-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/trebitowski.jpg', 'Using many examples, the book covers core features like accelerometers, GPS, the Address Book, and much more. Along the way, you''ll learn to leverage your iPhone skills to build attractive iPad apps. This is a revised and expanded edition of the original iPhone in Action.', 'P', '["Mobile Technology"]', 9);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988363', 'C# in Depth', 424, '2008-04-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/skeet.jpg', 'Sin resumen', 'P', '["Microsoft .NET"]', 7);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182129', 'Ten Years of UserFriendly.Org', 1096, '2008-12-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/userfriendly.jpg', 'This unique collector''s volume includes every daily strip from November 17, 1997 to November 16, 2007. Many of the cartoons are annotated with comments from UserFriendly artist and creator JD    Illiad    Frazer.', 'P', '["Miscellaneous"]', 5);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1932394354', 'Spring in Action', 472, '2005-02-01', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/walls2.jpg', 'Spring in Action introduces you to the ideas behind Spring and then quickly launches into a hands-on exploration of the framework. Combining short code snippets and an ongoing example developed throughout the book, it shows you how to build simple and efficient J2EE applications. You will see how to solve persistence problems using the leading open-source tools, and also how to integrate your application with the most popular web frameworks. You will learn how to use Spring to manage the bulk of your infrastructure code so you can focus on what really matters     your critical business needs.', 'P', '["Java"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182358', 'Spring in Action, Third Edition', 424, '2011-06-21', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/walls4.jpg', 'Spring in Action, Third Edition has been completely revised to reflect the latest features, tools, practices Spring offers to java developers. It begins by introducing the core concepts of Spring and then quickly launches into a hands-on exploration of the framework. Combining short code snippets and an ongoing example developed throughout the book, it shows you how to build simple and efficient J2EE applications.', 'P', '["Java"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182056', 'Spring in Practice', 600, '2013-05-09', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/wheeler.jpg', 'Spring in Practice diverges from other cookbooks because it presents the background you need to understand the domain in which a solution applies before it offers the specific steps to solve the problem. You''re never left with the feeling that you understand the answer, but find the question irrelevant. You can put the book to immediate use even if you don''t have deep knowledge of every part of Spring Framework.', 'P', '["Java", "Software Development"]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182714', 'SharePoint 2010 Workflows in Action', 360, '2011-02-07', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/wicklund.jpg', 'SharePoint 2010 Workflows in Action is a hands-on guide for workflow application development in SharePoint. Power users are introduced to the simplicity of building and integrating workflows using SharePoint Designer, Visio, InfoPath, and Office. Developers will learn to build custom processes and use external data sources. They will learn about state machine workflows, ASP.NET forms, event handlers, and much more. This book requires no previous experience with workflow app development. ', 'P', '["Microsoft .NET"]', 8);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1935182773', 'SharePoint 2010 Web Parts in Action', 448, '2011-04-24', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/wilen.jpg', 'SharePoint 2010 Web Parts in Action is a comprehensive guide to deploying, customizing, and creating Web Parts. Countless examples walk you through everything from design, to development, deployment, troubleshooting, and upgrading. Because Web Parts are ASP.NET controls, you''ll learn to use Visual Studio 2010 to extend existing Web Parts and to build custom components from scratch. ', 'P', '["Microsoft .NET"]', 9);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1933988770', 'C++ Concurrency in Action', 325, '2012-02-24', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/williams.jpg', 'C++ Concurrency in Action is the first book to show you how to take advantage of the new C++ Standard and TR2 to write robust multi-threaded applications in C++.', 'P', '["Microsoft .NET"]', 9);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('9781935182078', 'The Engaging Web', 325, NULL, 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/zichermann.jpg', 'The Engaging Web: How Fun and Games Improve Your Site shows web developers how to incorporate games into websites. This book will help you decode the possibilities and provide a series of proven and tangible strategies that any web developer, producer, or product manager can use to implement games in their website. Whether you''re looking to make games the centerpiece of your site, an added-value feature, or you just want to engage and excite your users, The Engaging Web will help you develop a strategy that harnesses the power of games.', 'M', '["Web Development"]', 9);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1617290246', 'Arduino in Action', 300, '2013-05-30', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/mevans.jpg', 'Arduino in Action is a hands-on guide to prototyping and building electronics using the Arduino platform. Suitable for beginners and advanced users, this easy to follow book begins with the basics and systematically guides you through projects ranging from your first blinking LED through connecting Arduino to devices like game controllers or your iPhone.', 'P', '[]', 2);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1617290572', 'Node.js in Action', 300, '2013-10-15', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/cantelon.jpg', 'Node.js in Action is an example-driven tutorial that starts at square one and guides you through all the features, techniques, and concepts you''ll need to build production-quality Node applications. You''ll start by learning how to set up your Node development environment, including loading the community-created extensions. Next, you''ll run several simple demonstration programs where you''ll learn the basics of a few common types of Node applications. Then you''ll dive into asynchronous programming, a model Node leverages to lessen application bottlenecks.', 'P', '["Web Development"]', 6);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1617290491', 'HTML5 in Action', 375, '2014-02-10', 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/crowther2.jpg', 'HTML5 In Action provides a complete introduction to web development using HTML5. You''ll explore every aspect of the HTML5 specification through real-world examples and code samples. It''s much more than just a specification reference, though. It lives up to the name HTML5 in Action by giving you the practical, hands-on guidance you''ll need to use key features.', 'P', '[]', 3);
INSERT INTO libreria_libro (isbn, titulo, paginas, fecha_publicacion, imagen, desc_corta, estatus, categoria, editorial_id) VALUES ('1617291617', 'ArcGIS Web Development', 0, NULL, 'https://s3.amazonaws.com/AKIAJC5RLADLUMVRPFDQ.book-thumb-images/rubalcava.jpg', 'Sin resumen', 'M', '[]', 7);
